			"label": "berd_man",
			"on_talk": "speech_dialog(
						music('Chipperuni.ogg'),
						set(level.player.animation, 'emote_raisedfinger'),
		level.player,	[~Hi, again.~],
		self,			[~So, how did it go?~],
						set(level.player.animation, 'emote_talk'),
		level.player,	[~Could've been worse.~],
						set(level.player.animation, 'emote_oh'),
						[~That ... uh, \"captain\" cat, or whoever he was,
tried to dice me up.~],
						set(level.player.animation, 'emote_geez'),
						[~Naturally, we wouldn't be having
this conversation if I hadn't gotten
the better of him.~],
						set(level.player.animation, 'emote_confused'),
						[~So all's well
that ends well, I suppose.~],
						set(level.player.animation, 'emote_raisedfinger'),
						[~I did find out what was going on, at least,
that is, what the elder *says* is going on.~],
						set(level.player.animation, 'emote_confused'),
						[~I wouldn't mind running this by a few people,
since I have no idea what's true, or not.~],
						
		self,			[~Go right ahead.~],
						
						set(level.player.animation, 'emote_talk'),
		level.player,	[~So... uhm... loosely speaking, he says
that Milgram loaned him money, and this whole
incident was Milgram coming to shake him down.~],
						set(level.player.animation, 'emote_talk'),
						[~Trying to get his money back.~],
						set(level.player.animation, 'emote_geez'),
						[~So then he tells this oddball story
about how it's all some plot where
Milgram's gonna take over the town.~],
						
		self,			[~Wow.~],
						[~I've never heard of any of this.~],
						
						set(level.player.animation, 'emote_talk'),
		level.player,	[~Really?
He's never talked about this?~],
						
		self,			[~Never.~],
						
						set(level.player.animation, 'emote_confused'),
		level.player,	[~Has he ever shown any signs of ... suddenly
having way more spending money than usual?~],
						
		self,			[~Well, he's *bragged* about being rich,
but that's just his \"dignified family\" schtick.~],
						[~He's such a miser, you know -
the man would probably burn his
furniture just to save on firewood.~],
						[~So, no, he's never seemed
to have a dime to spare.~],
						[~He does brag about being known by important
people, but you know how he is.~],
						
						set(level.player.animation, 'emote_confused'),
		level.player,	[~Yeah.  Geez.
So, uh, here's what I think we know:~],
						set(level.player.animation, 'emote_raisedfinger'),
						[~We know he's clearly run afoul
of Milgram, somehow.~],
						set(level.player.animation, 'emote_confused'),
						[~We also know Milgram's not interested
in taking over the town, because he
essentially just did, and gave it up.~],
						set(level.player.animation, 'emote_raisedfinger'),
						[~We don't know if the money thing
is true, but we know if it is,
he certainly hasn't put it to use.~],
						set(level.player.animation, 'emote_confused'),
						[~Oh yeah, I forgot to mention;
he said it was some kind of \"investment\"~],
						set(level.player.animation, 'emote_talk'),
						[~Which I assume would be for the town.
Building things.~],
						set(level.player.animation, 'emote_impatient'),
						[~Naturally, we know that didn't happen.~],
						set(level.player.animation, 'emote_talk'),
						[~So other than that, it's a mystery.~],
						
		self,			[~So, dare I ask:
What do we do now?~],
						
						set(level.player.animation, 'emote_raisedfinger'),
		level.player,	[~Ah, that.  I went and decided that
it's probably a very good idea to
do a little diplomacy.~],
						set(level.player.animation, 'emote_geez'),
						[~*Someone* needs to go talk to Milgram,
and ask what was wrong, so nothing bad happens.~],
						set(level.player.animation, 'emote_talk'),
						[~So for a lack of any other willing parties,
I decided to go.~],
						
		self,			[~That's very noble of you.~],
						
						set(level.player.animation, 'emote_geez'),
		level.player,	[~Ha, well, we're also going to find out
if it's very foolish, as well.~],
						
						set(level.player.animation, 'emote_impatient'),
						[~But nothing ventured, nothing gained, you know?
I guess I'm just tired of bumming around.~],
						set(level.player.animation, 'emote_raisedfinger'),
						[~Speaking of which, I'd been meaning
to thank you for your help thus far.~],
						set(level.player.animation, 'emote_talk'),
						[~I've really appreciated the \"eyes in the sky\".
It's very helpful.~],
						
		self,			[~To spare your asking,
yes, I'd be happy to continue.~],
						
						set(level.player.animation, 'emote_oh'),
		level.player,	[~Hey, thanks, that's really nice of you!~],
						
		self,			[~It's the least I can do.
I'd offer to carry you, even,
but I'm afraid that's physically impossible.~],
						[~I'm as curious as you are, about this,
and we're more likely to get to the
bottom of things if we work together.~],
						
						set(level.player.animation, 'emote_talk'),
		level.player,	[~Awesome!~],
						
						set(level.player.animation, 'emote_talk'),
						[~Anyways, I was planning to go through
the forest, to start with.~],
						set(level.player.animation, 'emote_confused'),
						[~Does that sound like a good idea?~],
						
		self,			[~Yes... it is the only path I know of,
but be careful in there.~],

						set(level.player.animation, 'emote_raisedfinger'),
		level.player,	[~Yeah, no kidding.
Well, see you soon!  Thanks again!~]
		)",
